function colRowToArrayIndex(col, row) {
	return col + (TILE_COLS * row);
}

function tileTypeAtColRow(array, col, row) {
	if (col >= 0 && col < TILE_COLS &&
		row >= 0 && row < TILE_ROWS) {
			
		var arrayIndex = colRowToArrayIndex(col, row);
		return array[arrayIndex];
	}
	else {
		return TILE_OBSTACLE_BOX;
	}
}

function loadLevel(level) {
	tileGrid = level.slice();
}

function initialiseEntityPositions() {
	var enemy
	var tileType;
	var row, col;
	for (row = 0; row < TILE_ROWS; row++) {
		for (col = 0; col < TILE_COLS; col++) {
			tileType = tileTypeAtColRow(tileGrid, col, row);
			switch(tileType) {
			case PLAYER:
				Player.initialisePosition(col*TILE_W + (TILE_W), row*TILE_H + (TILE_H));
				moveCamToPlayer();
				var arrayIndex = colRowToArrayIndex(col, row);
				tileGrid[arrayIndex] = 0;
				break;
			case SHADOW:
				let shadowBoss = new ShadowBoss();
				shadowBoss.initialisePosition(col*TILE_W + (TILE_W), row*TILE_H + (TILE_H));
				Entities.push(shadowBoss);
				var arrayIndex = colRowToArrayIndex(col, row);
				tileGrid[arrayIndex] = 0;
				break;
			case BEAST:
				enemy = new BeastBoss();
				enemy.initialisePosition(col*TILE_W + (TILE_W), row*TILE_H + (TILE_H));
				Entities.push(enemy);
				var arrayIndex = colRowToArrayIndex(col, row);
				tileGrid[arrayIndex] = 0;
				break;
			case EVIL_PLAYER:
				enemy = new EvilPlayerBoss();
				enemy.initialisePosition(col*TILE_W + (TILE_W), row*TILE_H + (TILE_H));
				Entities.push(enemy);
				var arrayIndex = colRowToArrayIndex(col, row);
				tileGrid[arrayIndex] = 0;
				break;
			}
		}
	}
}

function generateFloorTiles() {
	var row, col;
	for (row = 0; row < TILE_ROWS; row++) {
		for (col = 0; col < TILE_COLS; col++) {
			floorTiles.push(Math.floor(Math.random() * 9));
		}
	}
}

function drawTiles() {
	canvasContext.save();
	canvasContext.translate(-camPanX, -camPanY);
	
	drawTilesOnScreen();
	
	canvasContext.restore();
}

